import {createMuiTheme} from '@material-ui/core/styles';


const theme = createMuiTheme({
    typography: {
        useNextVariants: true, 
        fontFamily: 'Bebas Neue, Roboto, Arial',
    },
    palette: {
        primary: {
            light: '#63ccff',
            main: '#212121',
            dark: '#006db3',
            contrastText: '#fff',
        },
    },
    shape: {
        borderRadius: 10
    },
    
});

export default theme;
